Brett Rossi In Her First Ever Boy-Girl Sex Scene!

At her going away party, Brett Rossi discovers some undiscovered feelings for her ex-boss Erik Everhard, who is now engaged to her sister BiBi Jones. Will she and Erik reconnect before the wedding?. Will she seduce Erik before leaving for her business school?. And ultimately, will she cross that line for a two year old working relationship?.

